export const rightToc = [];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`It is necessary to have R installed in order to be able to run this code. R is a free software environment for statistical computing and graphics. It compiles and runs on a wide variety of UNIX platforms, Windows and MacOS. To `}<a parentName="p" {...{
        "href": "https://cran.r-project.org/mirrors.html"
      }}>{`download R.`}</a>{`, please choose your preferred `}<a parentName="p" {...{
        "href": "https://cran.r-project.org/mirrors.html"
      }}>{`CRAN mirror.`}</a></p>
    <p>{`There are three main script files within the code:`}</p>
    <ol>
      <li parentName="ol"><strong parentName="li">{`fb_nextgen_mmm_v19.func.R:`}</strong>{` Where all the model functions are stored.`}</li>
      <li parentName="ol"><strong parentName="li">{`fb_nextgen_mmm_v19.exec.R:`}</strong>{` Where the functions above are executed. This will be the main script you will be working with.`}</li>
      <li parentName="ol"><strong parentName="li">{`fb_nextgen_mmm_v19.plot.R:`}</strong>{` Where the functions to plot results are kept.`}</li>
    </ol>
    <p>{`Please `}<strong parentName="p">{`download`}</strong>{` and `}<strong parentName="p">{`open`}</strong>{` all of them in your R environment.`}</p>
    </MDXLayout>;
}

;
